            <Card id="LoginCard">
                <h1>Login</h1>
        <Form>

            <Form.Group className="mb-3" controlId="formBasicEmail" class="form-group">
            <Row>
                <Col>
                <Form.Label class="formLabel">Email</Form.Label> 
                <Form.Control type="email" placeholder="" className="form-control" />
