            SignUp
            </Button>

            <div id="ForgotPassword"><Link to='#'><b>Forgot password?</b></Link></div>
            <div id="SignUpLink">Need an account?&nbsp;<Link to='./SignUpForm'><b>Sign Up</b></Link></div>
        </Form>
        </Card> 
        </div>

        );
    }
}

export default LoginForm;
